import React, { Fragment } from "react";

import Modal from '../UI/'

import styles from "./RegionsModal.module.css";

const RegionsModal = (props) => {

  const content = (
    <div className={styles.modal}>
      <div className={styles.content}>
        <div className={styles.header}>
          <h4 className={styles.title}>{props.name}</h4>
        </div>
        <div className={styles.body}>First we sift our matcha</div>
        <div className={styles.footer}>
          <button className="button">{props.onClose}</button>
        </div>
      </div>
    </div>
  );

  return (
    <Fragment>
      <Modal onClose={props.onClose}>{content}</Modal>
    </Fragment>
  );
};

export default RegionsModal;
